import React from "react";
import List from "./list/list";
import './race.css'
import PageTitle from "../page-title";

class PageRace extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            pos: 0
        }
    }

    render() {
        return (
            <div className="page-app" style={this.style_set}>
                <PageTitle>КЛАСС</PageTitle>
                <List />
            </div>
        );
    }
}

export default PageRace
